  var linkHeight = menuLinks[0].offsetHeight;
  var linkMargin = parseInt(window.getComputedStyle(menuLinks[0]).marginBottom);
  var linkTotalHeight = linkHeight + linkMargin;
  var currentSection;
  menuHandle();
