function changeSocialIcon() {
  var rootID = document.querySelector(this.currItem.src);
  var iconBlock = rootID.querySelector('.registry__round-block');

  if (iconBlock) {
    var mailInput = rootID.querySelector('.registry__input_email');
    var submitBtn = rootID.querySelector('.registry__link');
    var phoneInput = rootID.querySelector('.registry__input_phone').closest('.label');
    var iconList = iconBlock.querySelectorAll('.registry__round');
    iconBlock.addEventListener('click', function (e) {
      var icon = e.target.closest('.registry__round');
      var iconType = icon.getAttribute('data-contact');

      if (iconType === 'phone') {
        mailInput.classList.add('disabled');
        phoneInput.classList.remove('disabled');
        submitBtn.classList.remove('enabled');
      } else {
        mailInput.classList.remove('disabled');
        phoneInput.classList.add('disabled');
        submitBtn.classList.add('enabled');
      }

      iconList.forEach(function (icon) {
        return icon.classList.remove('z-index');
      });
      icon.classList.add('z-index');
    });
  }
}

